import { Grid } from './styles'

// Função que exporta a screen Logo
export function GridGames() {
  return (
    <div data-testid="home-page">
      <Grid>
        <a ></a>
        <img src={gameImg} alt="logo"/>
        <img src={gameImg} alt="logo"/>
        <img src={gameImg} alt="logo"/>
        <img src={gameImg} alt="logo"/>
        <img src={gameImg} alt="logo"/>
        <img src={gameImg} alt="logo"/>
      </Grid>

    </div>
  );
}
